import React, {Component} from 'react';
import Title from '../../UI/Title/Title';
import styles from './Card.module.scss';

export default class Card extends Component {


  render() {


    const {id, date, text, title} = this.props.property;

    return (

      <div key={id} className={styles.news__item}>
        <Title>
          <span className={styles.news__title}>{title}</span>
        </Title>
        <p className={styles.news__text}>{text}</p>
        <span className={styles.news__date}>{date}</span>
    </div>

    )

  }


}
